import Level from "./Level"

const upDownAnimation = keyframes`
  0% { transform: translateY(0); }
  50% { transform: translateY(-10px); }
  100% { transform: translateY(0); }
`;
const SkillsContainer = styled.div`
  display: flex;
  flex-wrap: nowrap;  // Ensure items don't wrap to next line
  overflow-x: auto;
  height:800px;
  white-space: nowrap;
  margin-top:100px;
  margin-bottom: 100px;
  margin-left:2px;
  background: linear-gradient(to right,#0B666A,  #14C38E);  // default colors are white and black
  animation: ${upDownAnimation} 2s infinite;  // Adjust the duration (2s here) as needed
  // Shadow and blur
  box-shadow: 0 1px 2px rgba(0, 0, 0, 0.1), 0 -1px 2px rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(1px);

  & > * {
    margin-right: 40px;
  }
  &::-webkit-scrollbar {
    display: none;  // Hide scrollbar for Chrome, Safari and Opera
  }
  scrollbar-width: none;  // Hide scrollbar for IE and Edge

`;




const Skills = () => {
  const skillsData = [
    {
      title: "Computer Science Fundamentals",
